import{_ as e,o as t,c as a,V as r}from"./chunks/framework.c5c8a48b.js";const _=JSON.parse('{"title":"swift和flutter的区别","description":"","frontmatter":{},"headers":[],"relativePath":"2023/ios学习/swi0fthe2flu0tte0rnei3ge4geng4hao3.md","filePath":"2023/ios学习/swi0fthe2flu0tte0rnei3ge4geng4hao3.md","lastUpdated":null}'),o={name:"2023/ios学习/swi0fthe2flu0tte0rnei3ge4geng4hao3.md"},s=r('<h1 id="swift和flutter的区别" tabindex="-1">swift和flutter的区别 <a class="header-anchor" href="#swift和flutter的区别" aria-label="Permalink to &quot;swift和flutter的区别&quot;">​</a></h1><ul><li>跨平台性肯定是<code>flutter</code>更好</li><li>如果项目只在<code>Android</code>生态或<code>ios</code>生态内运行，选择平台原生的开发框架就是更具可行性的选择。毕竟不管是Flutter还是RN，都只能提供绘制UI的功能。想要调用手机系统的其他功能如：定位、电池信息等都只能通过系统级的SDk</li></ul><p>以上是别人的博客里面的一些信息。总结一下就是：swift性能、一些底层的功能支持会更好一些，但是它做不了跨平台。如果一款app不需要一些系统底层的能力，只是简单的UI功能，那flutter良好的跨平台支持是更好的选择。</p><h2 id="swift-package-manager使用" tabindex="-1">Swift Package Manager使用 <a class="header-anchor" href="#swift-package-manager使用" aria-label="Permalink to &quot;Swift Package Manager使用&quot;">​</a></h2><p>Swift Package Manager是Apple为了弥补当前ios开发中缺少官方组件库管理工具的产物。相较于其他组件管理控件，他的定义文件更加轻松易懂，只需将源码放入相应的文件夹内，Xcode就会自动生成工程文件，并生成编译目标产物所需要的相关配置。同时，SPM与Cocoapods相互兼容，可以在特性上提供互补。 <a href="https://mp.weixin.qq.com/s/s2GZ13PVdVa5t-SABArtdA" target="_blank" rel="noreferrer">https://mp.weixin.qq.com/s/s2GZ13PVdVa5t-SABArtdA</a></p><p>字节跳动APM-ios团队外部技术分享汇总： <a href="https://bytedance.feishu.cn/docx/doxcnJubfgNEyrslVRjG7iW913e" target="_blank" rel="noreferrer">https://bytedance.feishu.cn/docx/doxcnJubfgNEyrslVRjG7iW913e</a></p><h2 id="使用阿里图标库" tabindex="-1">使用阿里图标库 <a class="header-anchor" href="#使用阿里图标库" aria-label="Permalink to &quot;使用阿里图标库&quot;">​</a></h2><p>Swift中如何使用阿里图标库：<a href="https://juejin.cn/post/7254107670012543013#comment" target="_blank" rel="noreferrer">https://juejin.cn/post/7254107670012543013#comment</a></p><h2 id="cocoapods如何发布公有库" tabindex="-1">Cocoapods如何发布公有库 <a class="header-anchor" href="#cocoapods如何发布公有库" aria-label="Permalink to &quot;Cocoapods如何发布公有库&quot;">​</a></h2><p><a href="https://juejin.cn/post/7257333598469439546" target="_blank" rel="noreferrer">https://juejin.cn/post/7257333598469439546</a></p><p>这位老哥用swift刷了很多的算法题：<a href="https://juejin.cn/user/2661268541946365/posts" target="_blank" rel="noreferrer">https://juejin.cn/user/2661268541946365/posts</a></p><p>SwiftUI的基础文章：<a href="https://juejin.cn/user/325111172054350/posts" target="_blank" rel="noreferrer">https://juejin.cn/user/325111172054350/posts</a></p>',12),n=[s];function i(c,l,p,f,h,d){return t(),a("div",null,n)}const g=e(o,[["render",i]]);export{_ as __pageData,g as default};
